The dynamic &amp; reformist police officer, Ex IGP KP, Nasir Khan Durrani is no more with us. He was suffering from COVID &amp; admitted in Mayo Hospital Lahore. 
Born on March17, 1957, he joined the police as ASP in 1982. He was from 10thCommon &amp; pioneer of Rescue-15.
